export default function InfoPage() {
  return (
    <Box p={4}>
      <Heading>Info</Heading>
      <Heading fontSize="sm">PRIVACY POLICY</Heading>
      <Text fontSize="xl"></Text>
      <Divider></Divider>
      <Text fontSize="md">
        Powered by <a></a>@matteocavallo
      </Text>
    </Box>
  );
}
